searchData={"items":[{"type":"module","title":"ToyIssues","doc":"Documentation for `ToyIssues`.","ref":"ToyIssues.html"},{"type":"function","title":"ToyIssues.hello/0","doc":"Hello world.","ref":"ToyIssues.html#hello/0"},{"type":"function","title":"Examples - ToyIssues.hello/0","doc":"iex> ToyIssues.hello()\n    :world","ref":"ToyIssues.html#hello/0-examples"},{"type":"module","title":"ToyIssues.CLI","doc":"명령줄 파싱을 수행한 뒤, 각종 함수를 호출해\n깃허브 프로젝트의 최근 _n_개 이슈를 표 형식으로 만들어 출력한다.","ref":"ToyIssues.CLI.html"},{"type":"function","title":"ToyIssues.CLI.args_to_internal_representation/1","doc":"","ref":"ToyIssues.CLI.html#args_to_internal_representation/1"},{"type":"function","title":"ToyIssues.CLI.decode_response/1","doc":"","ref":"ToyIssues.CLI.html#decode_response/1"},{"type":"function","title":"ToyIssues.CLI.last/2","doc":"","ref":"ToyIssues.CLI.html#last/2"},{"type":"function","title":"ToyIssues.CLI.main/1","doc":"","ref":"ToyIssues.CLI.html#main/1"},{"type":"function","title":"ToyIssues.CLI.parse_args/1","doc":"'argv'는 -h 또는 --help(이 경우 :help를 반환)이거나,\n깃허브 사용자 이름, 프로젝트 이름, (선택적으로) 가져올 이슈 개수여야 한다.\n\n'{사용자명, 프로젝트명, 이슈 개수}'또는 :help를 반환한다.","ref":"ToyIssues.CLI.html#parse_args/1"},{"type":"function","title":"ToyIssues.CLI.process/1","doc":"","ref":"ToyIssues.CLI.html#process/1"},{"type":"function","title":"ToyIssues.CLI.sort_into_descending_order/1","doc":"","ref":"ToyIssues.CLI.html#sort_into_descending_order/1"},{"type":"module","title":"ToyIssues.GithubIssues","doc":"","ref":"ToyIssues.GithubIssues.html"},{"type":"function","title":"ToyIssues.GithubIssues.fetch/2","doc":"","ref":"ToyIssues.GithubIssues.html#fetch/2"},{"type":"function","title":"ToyIssues.GithubIssues.handle_response/1","doc":"","ref":"ToyIssues.GithubIssues.html#handle_response/1"},{"type":"function","title":"ToyIssues.GithubIssues.issues_url/2","doc":"","ref":"ToyIssues.GithubIssues.html#issues_url/2"},{"type":"module","title":"ToyIssues.TableFormatter","doc":"","ref":"ToyIssues.TableFormatter.html"},{"type":"function","title":"ToyIssues.TableFormatter.format_for/1","doc":"숫자의 리스트를 받아, 표의 열을 나누는 포맷 문자열을 반환한다.\n각 열 사이에는 '\" | \"' 문자열을 넣는다.","ref":"ToyIssues.TableFormatter.html#format_for/1"},{"type":"function","title":"사용 예 - ToyIssues.TableFormatter.format_for/1","doc":"iex> widths = [5,6,99]\n  iex> ToyIssues.TableFormatter.format_for(widths)\n  \"~-5s | ~-6s | ~-99s~n\"","ref":"ToyIssues.TableFormatter.html#format_for/1-%EC%82%AC%EC%9A%A9-%EC%98%88"},{"type":"function","title":"ToyIssues.TableFormatter.print_table_for_columns/2","doc":"표의 각 행이 될 맵의 리스트와 헤더의 리스트를 받아,\n각 행에서 헤더를 기준으로 데이터를 식별해 표준 출력(STDOUT)으로 표를 표시한다.\n즉 각 헤더는 표의 열이 되며, 이를 이용해 각 행에서 필드의 값을 추출해 출력한다.\n\n각 열의 가로 길이는 해당 열의 가장 긴 값에 맞도록 계산한다.","ref":"ToyIssues.TableFormatter.html#print_table_for_columns/2"},{"type":"function","title":"ToyIssues.TableFormatter.printable/1","doc":"파라미터를 바이너리(문자열)로 변환해 반환한다.","ref":"ToyIssues.TableFormatter.html#printable/1"},{"type":"function","title":"사용 예 - ToyIssues.TableFormatter.printable/1","doc":"iex> ToyIssues.TableFormatter.printable(\"a\")\n  \"a\"\n  iex> ToyIssues.TableFormatter.printable(99)\n  \"99\"","ref":"ToyIssues.TableFormatter.html#printable/1-%EC%82%AC%EC%9A%A9-%EC%98%88"},{"type":"function","title":"ToyIssues.TableFormatter.puts_in_columns/2","doc":"데이터의 행으로 이루어진 리스트, 필드 리스트, 포맷 문자열을 받아\n포맷 문자열의 형식으로 추출한 데이터를 출력한다.","ref":"ToyIssues.TableFormatter.html#puts_in_columns/2"},{"type":"function","title":"ToyIssues.TableFormatter.puts_one_line_in_columns/2","doc":"","ref":"ToyIssues.TableFormatter.html#puts_one_line_in_columns/2"},{"type":"function","title":"ToyIssues.TableFormatter.separator/1","doc":"표의 제목 행 아래에 올 구분선을 만든다.\n열 구분선과 같은 위치에는 +기호, 그 외의 자리에는 - 기호를 사용한다.","ref":"ToyIssues.TableFormatter.html#separator/1"},{"type":"function","title":"사용 예 - ToyIssues.TableFormatter.separator/1","doc":"iex> widths = [5,6,9]\n  iex> ToyIssues.TableFormatter.separator(widths)\n  \"------+--------+----------\"","ref":"ToyIssues.TableFormatter.html#separator/1-%EC%82%AC%EC%9A%A9-%EC%98%88"},{"type":"function","title":"ToyIssues.TableFormatter.split_into_columns/2","doc":"각 행이 키-값 쌍으로 이루어진 리스트일 때, 이 행의 리스트를 받아\n각 필드의 값만으로 이루어진 리스트를 반환한다.\n'header' 파라미터는 추출할 필드(열) 이름이 담긴 리스트다.","ref":"ToyIssues.TableFormatter.html#split_into_columns/2"},{"type":"function","title":"사용 예 - ToyIssues.TableFormatter.split_into_columns/2","doc":"iex> list = [ Enum.into( [{\"a\", \"1\"}, {\"b\", \"2\"}, {\"c\",\"3\"}], %{} ), Enum.into( [{\"a\", \"4\"}, {\"b\", \"5\"}, {\"c\",\"6\"}], %{}) ]\n  iex> ToyIssues.TableFormatter.split_into_columns(list, [\"a\", \"b\", \"c\"])\n  [ [\"1\", \"4\"], [\"2\", \"5\"], [\"3\", \"6\"] ]","ref":"ToyIssues.TableFormatter.html#split_into_columns/2-%EC%82%AC%EC%9A%A9-%EC%98%88"},{"type":"function","title":"ToyIssues.TableFormatter.widths_of/1","doc":"데이터를 담은 리스트를 포함하는 중첩 리스트를 받아,\n각 열의 최대 길이가 담긴 리스트를 반환한다.","ref":"ToyIssues.TableFormatter.html#widths_of/1"},{"type":"function","title":"사용 예 - ToyIssues.TableFormatter.widths_of/1","doc":"iex> data = [ [\"cat\", \"wombat\", \"elk\"], [\"mongoose\", \"ant\", \"gnu\"] ]\n  iex> ToyIssues.TableFormatter.widths_of(data)\n  [6, 8]","ref":"ToyIssues.TableFormatter.html#widths_of/1-%EC%82%AC%EC%9A%A9-%EC%98%88"}],"proglang":"elixir","content_type":"text/markdown","producer":{"name":"ex_doc","version":"0.35.0"}}